text:
1:39:00 根据DSM-5（精神疾病诊断与统计手册），自恋型人格障碍症属于B群人格障碍症，开始于成年期早期并持续至今，表现常有以下特点:
1.夸大自我重要性，例如夸大自己的才华，并期待被人看重;
2.永远专注于成功、权力、美貌或理想爱情等幻想中;
3.认为自己独特，仅能被其他特殊人物或高位者所认可并与之相关联;
4.需要过度称赞;
5.不合理的认为自己有特殊权力或获得他人无条件顺从;
6.处理人际关系时显得自私，好以占便宜来满足自己的利益需求;
7.缺乏同理心，不愿意认同和感受他人的情感需求;
8.常嫉妒别人或认为别人嫉妒他;
9.常有傲慢行为或态度，显得自高自大。

自恋型人格障碍（narcissistic personality disorder，简称NPD）近期主要代表人物有：杨子、麦琳、周雨彤、好莱坞等。
